import Data from './Data'

const SuggestionBox = () => {
    const renderSuggestions = () => {
        Data.filter((a) => {
            console.log(a)
        })
    }


    return (
        <>
            {renderSuggestions()}
        </>
    )
}

export default SuggestionBox
